function clickButton(e){document.getElementById("buttonText").innerText="click",CrComLib.publishSignal("b","1",!0),CrComLib.publishSignal("n","1",Math.floor(65536*Math.random())),CrComLib.publishSignal("s","1",generateRandomText())}function releaseButton(e){document.getElementById("buttonText").innerText="release",CrComLib.publishSignal("b","1",!1)}function generateRandomText(){for(var e="",t="ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789",n=0;n<10;n++)e+=t.charAt(Math.floor(Math.random()*t.length));return e}function handleDigitalFB(e){$("#digitalFB")[0].innerText="Dig FB = "+e}function handleNumericFB(e){$("#numericFB")[0].innerText="Analog FB = "+e}function handleSerialFB(e){$("#serialFB")[0].innerText="Serial FB = "+e}function errorCallback(){$("#errorText")[0].innerText="error Callback!"}$("button").on({touchstart:function(e){e.preventDefault(),this.classList.toggle("active"),clickButton(e)},mousedown:function(e){e.preventDefault(),this.classList.toggle("active"),clickButton(e)},touchend:function(e){e.preventDefault(),this.classList.toggle("active"),releaseButton(e)},mouseup:function(e){e.preventDefault(),this.classList.toggle("active"),releaseButton(e)}}),$(document).ready(function(){$("#digitalSubscribeText")[0].innerText=CrComLib.subscribeSignal("b","fb1",handleDigitalFB,errorCallback),$("#numericSubscribeText")[0].innerText=CrComLib.subscribeSignal("n","fb1",handleNumericFB,errorCallback),$("#serialSubscribeText")[0].innerText=CrComLib.subscribeSignal("s","fb1",handleSerialFB,errorCallback)});